import React, { useState, useEffect } from "react";
import axios from "axios";

function PhoneticsList() {
  const { REACT_APP_HOST } = process.env;
  const [Phonetics, SetPhonetics] = useState([]);
  const fetchData = async () => {
    try {
      const { data: response } = await axios.get(
        `${REACT_APP_HOST}getPhoneticsList.php`
      );
      SetPhonetics(response);
      console.log(response);
    } catch (error) {
      console.error(error.message);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);
  const dataMap = data.map((d, i) => {
    return (
      <>
        <tr key={i}>
          <th scope="row">{i + 1}</th>
          <td>
            <Link className="card-title fw-bold" to={`/project/${d.ProjectID}`}>
              {d.ProjectN}
            </Link>
          </td>
          <td>{d.teamN}</td>
          <td>{d.teamColleage}</td>
          <td>{d.teamPhone}</td>
          <td>{d.userEmail}</td>
          <td>{d.ProjectD}</td>
          {d.ProjectProposal ? (
            <td>
              <a
                className="card-title fw-bold"
                href={
                  "http://" + REACT_APP_IP + ":7000/media/" + d.ProjectProposal
                }
                target="_blank"
                type="application/octet-stream"
                download={d.ProjectProposal}
              >
                تحميل
              </a>
            </td>
          ) : (
            <td>{msg}</td>
          )}
        </tr>
      </>
    );
  });
  return (
    <div className="midde_cont">
      <div className="container-fluid">
        <div className="row column_title">
          <div className="col-md-12">
            <div className="page_title">
              <h2>Title Page</h2>
            </div>
          </div>
        </div>
        <div className="row column1">
          <div className="col-md-2">
            <button className="button-50" role="button">
              A
            </button>
          </div>
          <div className="col-md-2">
            <button className="button-50" role="button">
              B
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
export default PhoneticsList;
